import React from 'react';

function Projects() {
  return (
    <div className="Projects">
        <p className="homeParagraph">#1 EXCEL PROJECT</p>
        <p className="homeParagraph">#2 ALONG THE WAY PROJECT</p>
        <p className="homeParagraph">#3 CURRENT PROJECT</p>
    </div>
  );
}

export default Projects;
